import React, { Component } from 'react'
import Head from './Head'
import Login from './Login'
import { CookiesProvider, withCookies } from 'react-cookie'
class Monitor extends Component {
    constructor() {
        super()
        this.state = {
            page: "0"
        }
    }

    componentDidMount() {
      let pages = this.state.page.toString()
    }

    propsMomitor = (e) => {
        console.log(e)
        this.setState({
            page: e.toString()
        })
    }

    componentWillReceiveProps(e) {
        console.log(e)

    }
    render() {
        return (
            <div>
                <CookiesProvider>
                    <Head toMonitor={this.propsMomitor} />
                    {this.state.page}
                </CookiesProvider>
            </div>
        )
    }
}

export default withCookies(Monitor)
